import React from 'react';

export default class Counter extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            value: props.initialValue
        };
    }

    render() {
        <div>
        return(<div>Counter: {this.state.value}</div>);
        <button>Click me</button>
        </div>
    }
}
